// SPDX-License-Identifier: MIT

pragma solidity ^0.8.19;

import "../node_modules/@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "../node_modules/@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "../node_modules/@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

contract CryptoToken is Ownable {
    using SafeERC20 for IERC20;

    address public taxedToken;
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    uint256 public taxPercentage = 10;

    constructor(address _taxedToken, address _uniswapV2Router) {
        taxedToken = _taxedToken;
        uniswapV2Router = IUniswapV2Router02(_uniswapV2Router);

        // Create a Uniswap V2 pair for the taxed token
        uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory())
            .createPair(taxedToken, uniswapV2Router.WETH());
    }
    function swapTokensForETH(uint256 tokenAmount) public onlyOwner {
    require(IERC20(taxedToken).balanceOf(address(this)) >= tokenAmount, "Insufficient token balance");

    // Calculate tax
    uint256 taxAmount = (tokenAmount * taxPercentage) / 100;

    // Approve token transfer to the router
    IERC20(taxedToken).safeApprove(address(uniswapV2Router), tokenAmount - taxAmount);

    // Perform the swap
    address[] memory path = new address[](2);
    path[0] = taxedToken;
    path[1] = uniswapV2Router.WETH();

    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        tokenAmount - taxAmount,
        0, // Accept any amount of ETH
        path,
        address(this),
        block.timestamp
    );
}
function withdraw(address to, uint256 amount) public onlyOwner {
    require(IERC20(taxedToken).balanceOf(address(this)) >= amount, "Insufficient token balance");
    IERC20(taxedToken).safeTransfer(to, amount);
}

}
